	insert into dbo.FileResource(TenantID, FileResourceMimeTypeID, OriginalBaseFilename, OriginalFileExtension, FileResourceGUID, FileResourceData, CreatePersonID, CreateDate, OrganizationIDFromTenant)
	select @TenantIDTo as TenantID, fr.FileResourceMimeTypeID, fr.OriginalBaseFilename, fr.OriginalFileExtension, NEWID(), fr.FileResourceData, @primaryContactPersonID as CreatePersonID, fr.CreateDate, o2.OrganizationID as OrganizationIDFromTenant
	from dbo.Organization o
	join dbo.Organization o2 on o.OrganizationGuid = o2.OrganizationGuid and o2.TenantID = @TenantIDTo
	join dbo.FileResource fr on o.LogoFileResourceID = fr.FileResourceID
	where o.TenantID = @TenantIDFrom

